import math
from functools import reduce
from operator import mul
num = ''
num_list = [int(i) for i in num]
initial = 0
mul_max = 1
final = 13
wum = 0
while wum < 986:
    if num_list[final] > num_list[final+1]:
        final += 1
        initial += 1
        wum += 1
        continue
    temp_mul = math.prod(num_list[initial:final])
    if temp_mul > mul_max:
        mul_max = temp_mul
    final += 1
    initial += 1
    wum += 1

print(mul_max)

